import React from 'react';

const Recipe = ({title, calories, image}) => {
    return(
        <div>
            <h1>{title}</h1>
            <p>{calories}</p>
            <image src={image}  alt="" height="50" width="50"/>
        </div>
    );
};

export default Recipe;
